import { combineReducers } from 'redux';
import DataLoading from './dataLoading';
import User from './setUser';
import RightDisplay from './showOnRight';
import Modal from './modalReducer';

export default combineReducers({
  DataLoading,
  User,
  RightDisplay,
  Modal
})
